import bookService from '../services/prodServ.service';
import boom from '@hapi/boom';

export const getAllBooks = async (req, res, next) => {
    try {
        const booksList = await bookService.listAll();
        if (!booksList || booksList.length === 0) {
            return res.status(404).json({ message: 'No se encontraron libros registrados.' });
        }
        return res.status(200).json(booksList);
    } catch (error) {
        console.error('Error en getAllBooks:', error);
        next(boom.internal(error.message));
    }
};

export const getBookById = async (req, res, next) => {
    try {
        const { id } = req.params;
        console.log('Parámetro recibido:', id);

        if (isNaN(Number(id))) {
            return res.status(400).json({ message: 'El ID debe ser un número válido.' });
        }

        const book = await bookService.findById(Number(id));
        if (!book) {
            return res.status(404).json({ message: 'Libro no encontrado.' });
        }
        return res.status(200).json(book);
    } catch (error) {
        console.error('Error en getBookById:', error);
        next(boom.internal(error.message));
    }
};

export const createBook = async (req, res, next) => {
    try {
        const newBook = await bookService.create(req.body);
        if (!newBook) {
            throw boom.badRequest('No se pudo crear el libro.');
        }
        return res.status(201).json(newBook);
    } catch (error) {
        console.error('Error en createBook:', error);
        next(boom.internal(error.message));
    }
};

export const updateBook = async (req, res, next) => {
    try {
        const { id } = req.params;
        console.log('ID recibido para actualizar:', id);

        if (isNaN(Number(id))) {
            return res.status(400).json({ message: 'El ID debe ser un número válido.' });
        }

        const updatedBook = await bookService.update(Number(id), req.body);
        if (!updatedBook) {
            return res.status(404).json({ message: 'Libro no encontrado.' });
        }
        return res.status(200).json(updatedBook);
    } catch (error) {
        console.error('Error en updateBook:', error);
        next(boom.internal(error.message));
    }
};

export const deleteBook = async (req, res, next) => {
    try {
        const { id } = req.params;
        console.log('ID recibido para eliminar:', id);

        if (isNaN(Number(id))) {
            return res.status(400).json({ message: 'El ID debe ser un número válido.' });
        }

        const deletedBook = await bookService.delete(Number(id));
        if (!deletedBook) {
            return res.status(404).json({ message: 'Libro no encontrado.' });
        }
        return res.status(200).json({ message: 'Libro eliminado exitosamente.' });
    } catch (error) {
        console.error('Error en deleteBook:', error);
        next(boom.internal(error.message));
    }
};

