import Book from '../models/ProdServ';

class BookService {
    async listAll() {
        try {
            return await Book.find({});
        } catch (error) {
            console.error('Error en listAll:', error);
            throw error;
        }
    }

    async findById(bookId) {
        try {
            console.log('ID buscado en base de datos:', bookId);
            return await Book.findOne({ id: bookId });
        } catch (error) {
            console.error('Error en findById:', error);
            throw error;
        }
    }

    async create(bookData) {
        try {
            const book = new Book(bookData);
            return await book.save();
        } catch (error) {
            console.error('Error en create:', error);
            throw error;
        }
    }

    async update(bookId, bookData) {
        try {
            return await Book.findOneAndUpdate({ id: bookId }, bookData, { new: true });
        } catch (error) {
            console.error('Error en update:', error);
            throw error;
        }
    }

    async delete(bookId) {
        try {
            const result = await Book.findOneAndDelete({ id: bookId });
            if (!result) {
                throw new Error('Libro no encontrado');
            }
            return result;
        } catch (error) {
            console.error('Error en delete:', error);
            throw error;
        }
    }
}

export default new BookService();

